import React from 'react';
import Head from "next/head";
import AppLayout from "../components/AppLayout";

const Profile = () =>{
    return (
        <>
            <Head>
                <title>내 프로필 | NodeBird</title>
            </Head>
            <AppLayout>
                <NicknameEditForm/>
                <FollowerList header="팔로잉 목록"/>
                <FollowingList header="팔로워 목록"/>
            </AppLayout>
        </>
    );
};

export default Profile;
